const ReviewList = [
  {
    id: 1,
    name: "Mouse",
    rating: 4,
    comment:
     "This mouse is very high quality",
  },
  {
    id: 2,
    name: "Keyboard",
    rating: 5,
    comment: "This keyboard is wireless",
  },
  {
    id: 3,
    name: "Monitor",
    rating: 2,
    comment:
      "I have small monotor",
  }
]

export default ReviewList;
